import React from 'react'
import styled from 'styled-components'

const Title = styled.div`
  font-size: 50px;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100vw;
  color: ${({ theme }) => theme.colors.white};
`

export default () => <Title>Soon</Title>
